import React from 'react';

export default class HomePage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.updateUserProfile = this.updateUserProfile.bind(this);
    this.updateProfilePassword = this.updateProfilePassword.bind(this);
  }

  render() {
    return (
      <div>
       Buy Sell
      </div>
    );
  }
}
